import img from "../../../assets/img/backgroundSignin.jpg"
import classes from "./AddRoomPage.module.css"
import { Link, useParams } from "react-router-dom";
import { useContext, useState } from "react"
import AuthContext from '../../../store/auth-context';
import {createRoomApi} from '../../../api/RoomApi'

const typeData = [
    {
        text: "Family House",
        value: "0"
    },
    {
        text: "House & Villa",
        value: "1"
    },
    {
        text: "Apartment",
        value: "2"
    },
    {
        text: "Office & Studio",
        value: "3"
    },
    {
        text: "Villa & Condo",
        value: "4"
    },
    
]

const AddRoomPage = () => {
    const params = useParams()

    const id = params.id
    
    const authCtx = useContext(AuthContext)
    
    const [values, setValues] = useState({
        house_id: id,
        room_name: '',
        room_type: '0',
        area: 0,
        max_tenant: 1,
        rent_price: 0,
        water_price: 0,
        electricity_price: 0,
        service_price: 0,
        detail: '',
    })
    
    const{house_id, room_name, room_type, area, max_tenant, 
        rent_price, water_price, electricity_price, service_price, detail} = values
        
    const handleChange = (key) => {
        return (event) => {
            setValues({...values, [key]: event.target.value})
        }
    }
    
    const submitHandler = (event) => {
        event.preventDefault();
        
        const room = {
            house_id: house_id,
            room_name: room_name,
            room_type: room_type,
            area: area,
            max_tenant: max_tenant,
            rent_price: rent_price,
            water_price: water_price,
            electricity_price: electricity_price,
            service_price: service_price,
            detail: detail,
        }
        
        // optional: Add validation
        
        fetch(
            'http://localhost:8080/api/balanha/addroom',
            {
                method: 'POST',
                body: JSON.stringify({
                    house_id: house_id,
                    room_name: room_name,
                    room_type: room_type,
                    //manager_id: manager_id,
                    area: area,
                    max_tenant: max_tenant,
                    rent_price: rent_price,
                    water_price: water_price,
                    electricity_price: electricity_price,
                    service_price: service_price,
                    detail: detail,
                }),
                headers: {
                    'Content-Type': 'application/json',
                    'user_id': `${authCtx.userId}`, 
                    'token': `${authCtx.token}`
                },
            }
        ).then((res) => {
            if (res.ok) {
                return res.json();
            } else {
                return res.json().then((data) => {
                    let errorMessage = 'Authentication failed!';
                    // if (data && data.error && data.error.message) {
                    //   errorMessage = data.error.message;
                    // }
        
                    throw new Error(errorMessage);
                });
            }
        })
        .then((data) => {
            console.log(data)
            //alert("Success")
        })
        .catch((err) => {
            alert(err.message);
        });
    }
    
    return (
        <section className={classes.back}>
            <div className={classes.center}>
                <h1>Add Room</h1>
                <form method="POST" onSubmit={submitHandler}>
                    <div className={classes.txt_field}>
                        <select 
                            value={room_type}
                            onChange={handleChange('room_type')}
                        >
                            {typeData.map(type => <option value={type.value}>{type.text}</option>)}
                        </select>
                        <span></span>
                        <label>Type</label>
                    </div>
                    <div className={classes.txt_field}>
                        <input type="text" required value={room_name}
                            onChange={handleChange('room_name')}/>
                        <span></span>
                        <label>Name</label>
                    </div>
                    <div className={classes.txt_field}>
                        <input type="number" required value={area}
                            onChange={handleChange('area')}/>
                        <span></span>
                        <label>Area</label>
                    </div>
                    <div className={classes.txt_field}>
                        <input type="number" required value={rent_price}
                            onChange={handleChange('rent_price')}/>
                        <span></span>
                        <label>Rent Price</label>
                    </div>
                    <div className={classes.txt_field}>
                        <input type="number" required value={water_price}
                            onChange={handleChange('water_price')}/>
                        <span></span>
                        <label>Water Price</label>
                    </div>
                    <div className={classes.txt_field}>
                        <input type="number" required value={electricity_price}
                            onChange={handleChange('electricity_price')}/>
                        <span></span>
                        <label>Electricity Price</label>
                    </div>
                    <div className={classes.txt_field}>
                        <input type="number" required value={service_price}
                            onChange={handleChange('service_price')}/>
                        <span></span>
                        <label>Service Price</label>
                    </div>
                    <div className={classes.txt_field}>
                        <input type="text" required value={detail}
                            onChange={handleChange('detail')}/>
                        <span></span>
                        <label>Detail</label>
                    </div>
                    <button type="submit">Add</button>
                    <div className={classes.signup_link}>
                        <Link to="/">home</Link>
                    </div>
                </form>
            </div>
            <img src={img} alt='' />
        </section>
    )
}

export default AddRoomPage
